(defdist sqltime
  []
  [hhdist (uniform-discrete -838 839)
   midist (uniform-discrete 0 60)
   ssdist (uniform-discrete 0 60)
   matcher (partial re-find #"^-*(\d+):(\d\d):(\d\d)")]
  (sample* [this] (join [(sample* hhdist) ":" (sample* midist) ":" (sample* ssdist)]))
  (observe* [this val] (try
                         (let [parse (rest (matcher val))]
                         (if (empty? parse)
                           NEGINF
                            
                             (let [[hh mi ss] (map #(Integer/parseInt %) parse)
                                   prob (+ (observe* hhdist hh) (observe* hhdist mi) (observe* hhdist ss))]
                           	  	(if (not= prob NEGINF)
                                  0
                                  NEGINF))
                             ))(catch Exception e NEGINF))))
