(defdist sqldate
  [stamp]
  [yyyydist (if stamp
              (uniform-discrete 1970 2039)
              (uniform-discrete 1000 10000))
   mmdist (uniform-discrete 0 13)
   dddist (uniform-discrete 0 32)
   matcher (partial re-find #"^(\d\d\d\d)-(\d\d)-(\d\d)")]
  (sample* [this] (join [(sample* yyyydist) "-" (sample* mmdist) "-" (sample* dddist)]))
  (observe* [this val] (try
                         (let [parse (rest (matcher val))]
                         (if (empty? parse)
                           NEGINF
                            
                             (let [[yyyy mm dd] (map #(Integer/parseInt %) parse)
                                   prob (+ (observe* yyyydist yyyy) (observe* mmdist mm) (observe* dddist dd))]
                           	  	(if (not= prob NEGINF)
                                  0
                                  NEGINF))
                             ))(catch Exception e NEGINF))))
