(defdist sqldatetime
  "sqldatetime distribution which is either a timestamp or not
   depending on the stamp argument"
  [stamp]
  [matcher (partial re-find #"^(\d\d\d\d-\d\d-\d\d)(\s+)-*(\d+:\d\d:\d\d)")]
  (sample* [this] (join (sample* (sqldate stamp)) (sample* (randomwhitespacedist)) (sample* (sqltime))))
  (observe* [this val] (try 
                         (let [parse (rest (matcher val))]
                         (if (empty? parse)
                           NEGINF
                            
                             (let [[date space time] parse
                                   _ (prn [date time])
                                   prob (+ (observe* (sqldate stamp) date) 
                                           (observe* (randomwhitespacedist) space) 
                                           (observe* (sqltime) time))]
                               (if (not= prob NEGINF)
                                  0
                                  NEGINF)
                               )))(catch Exception e NEGINF))))
