(defdist sqlyear
  []
  [yyyydist (uniform-discrete 1901 2156)
   yydist (uniform-discrete 0 100)
   matcher (partial re-find #"^(\d{2}$|\d{4}$)")]
  (sample* [this] (join [(if (sample* (flip 0.5)) (sample* yyyydist) (sample* yydist))]))
  (observe* [this val] (try
                         (let [parse (first (rest (matcher val)))]
                         (if (nil? parse)
                           NEGINF
                            
                             (let [len (count parse)
                                   yyy (Integer/parseInt parse)
                                   prob (if (= 2 len) 
                                          (observe* yydist yyy) 
                                          (observe* yyyydist yyy))]
                               (if (not= prob NEGINF)
                                 0
                                 NEGINF))
                             ))(catch Exception e NEGINF))))
