(defdist state
  []
  [stateabbvs ["AL"	"AK"	"AZ"	"AR"	"CA"	"CO"	"CT"	"DE"	"FL"	"GA"	"HI"	"ID"	"IL"	"IN"	"IA"	"KS"	"KY"	"LA"	"ME"	"MD"	"MA"	"MI"	"MN"	"MS"	"MO"	"MT"	"NE"	"NV"	"NH"	"NJ"	"NM"	"NY"	"NC"	"ND"	"OH"	"OK"	"OR"	"PA"	"RI"	"SC"	"SD"	"TN"	"TX"	"UT"	"VT"	"VA"	"WA"	"WV"	"WI"	"WY"]
   statenames ["ALABAMA"	"ALASKA"	"ARIZONA"	"ARKANSAS"	"CALIFORNIA"	"COLORADO"	"CONNECTICUT"	"DELAWARE"	"FLORIDA"	"GEORGIA"	"HAWAII"	"IDAHO"	"ILLINOIS"	"INDIANA"	"IOWA"	"KANSAS"	"KENTUCKY"	"LOUISIANA"	"MAINE"	"MARYLAND"	"MASSACHUSETTS"	"MICHIGAN"	"MINNESOTA"	"MISSISSIPPI"	"MISSOURI"	"MONTANA"	"NEBRASKA"	"NEVADA"	"NEW HAMPSHIRE"	"NEW JERSEY"	"NEW MEXICO"	"NEW YORK"	"NORTH CAROLINA"	"NORTH DAKOTA"	"OHIO"	"OKLAHOMA"	"OREGON"	"PENNSYLVANIA"	"RHODE ISLAND"	"SOUTH CAROLINA"	"SOUTH DAKOTA"	"TENNESSEE"	"TEXAS"	"UTAH"	"VERMONT"	"VIRGINIA"	"WASHINGTON"	"WEST VIRGINIA"	"WISCONSIN"	"WYOMING"]
   abbrvdist (categorical (zipmap stateabbvs (repeat (count stateabbvs) 1)))
   namesdist (categorical (zipmap statenames (repeat (count stateabbvs) 1)))]
  (sample* [this] (flip-cases
                    (let [aon (sample* (flip 0.5))]
                      (if aon (sample* abbrvdist)
                        (sample* namesdist)))))
  (observe* [this val] (try 
                         (let [up (upper-case val)
                               s1 (observe* abbrvdist up)
                               s2 (observe* namesdist up)]
                           (if (or (> s1 NEGINF) (> s2 NEGINF))
                             0
                             NEGINF))
                         (catch Exception e NEGINF))))
