(defdist uszipcode
  []
  [plus4 (flip 0.5)
   matcher (partial re-find #"^(\d{5})$|(\d{5})-(\d{4})$")]
  (sample* [this] (if (sample* plus4)
                    (format "%05d" (sample* (uniform-discrete 0 100000)))
                    (format "%05d-%04d" (sample* (uniform-discrete 0 100000))
                                        (sample* (uniform-discrete 0 10000)))))
  (observe* [this val]
            (try (let [parse (matcher val)]
                   (if (nil? parse) 
                     NEGINF
                     0))
              (catch Exception e NEGINF))))
