(def macprolayout
  [[["`" "1" "2" "3" "4" "5" "6" "7" "8" "9" "0" "-" "="]
    ["\t" "q" "w" "e" "r" "t" "y" "u" "i" "o" "p" "[" "]" "\\"]
    [nil "a" "s" "d" "f" "g" "h" "j" "k" "l" ";" "'"]
    [nil "z" "x" "c" "v" "b" "n" "m" "," "." "/"]
    [nil nil nil " " " " " "]]

   [["~" "!" "@" "#" "$" "%" "^" "&" "*" "(" ")" "_" "+"]
    [nil "Q" "W" "E" "R" "T" "Y" "U" "I" "O" "P" "{" "}" "|"]
    [nil "A" "S" "D" "F" "G" "H" "J" "K" "L" ":" "'"]
    [nil "Z" "X" "C" "V" "B" "N" "M" "<" ">" "?"]
    [nil nil nil " " " " " "]]])

(defn all-keys [layout]
  (filter #(not= % nil) (flatten layout)))

(defdist randomstring 
  [l]
  [dist (categorical (zipmap (all-keys macprolayout) (repeat (count (all-keys macprolayout)) 1)))]
  (sample* [this] (join (repeatedly l #(sample* dist))))
  (observe* [this v] (* 1 (reduce #(+ %1 (observe* dist (str %2))) 0 v))))
