(with-primitive-procedures [uszipcode sqldate sqldatetime sqltime sqlyear state randomstring]
  (defquery column-type [vector-of-obs]
    (let [type (sample (categorical [[:unk 5] [:us-zip 5] [:date 5] [:datetime 5] [:timestamp 5] [:time 5] [:year 5] [:state 5]]))]
      (cond 
        (= type :us-zip) (map #(observe (uszipcode) %) vector-of-obs)
        (= type :date) (map #(observe (sqldate false) %) vector-of-obs)
        (= type :datetime) (map #(observe (sqldatetime false) %) vector-of-obs)
        (= type :timestamp) (map #(observe (sqldatetime true) %) vector-of-obs)
        (= type :time) (map #(observe (sqltime) %) vector-of-obs)
        (= type :year) (map #(observe (sqlyear) %) vector-of-obs)
        (= type :state) (map #(observe (state) %) vector-of-obs)
        :else (map #(observe (randomstring (count %)) %) vector-of-obs)
      )
      type)))
